import React from 'react'

const Avatar = ({children,backgroundColor, Padding, color, borderRadius,textAlign, fontSize, cursor, px,py}) => {
  const style={
    backgroundColor,
    Padding:`${px} ${py}`,
    color:color||"black",
    borderRadius,
    fontSize:"20px",
    textAlign:"center",
    textDecoration:"none"
  }
  return (
    <div style={style}>{children}</div>
  )
}

export default Avatar
